const React = require('react');

class Home extends React.Component {
  render() {
    const { result } = this.props; // Assuming 'result' is passed as a prop

    return (
      <div>
        <h1>User Data:</h1>
        <ul>
          {result.map(user => (
            <li key={user.UserID}>
              <p>UserID: {user.UserID}</p>
              <p>Username: {user.Username}</p>
              <p>PasswordHash: {user.PasswordHash}</p>
              <p>EmailID: {user.EmailID}</p>
              <p>UserAddress: {user.UserAddress}</p>
              <p>Phone: {user.Phone}</p>
              <p>UserRole: {user.UserRole}</p>
            </li>
          ))}
        </ul>
      </div>
    );
  }
}

module.exports = Home;
